import React from 'react';
import {Link, withRouter} from 'react-router-dom';
import './List.css';

const list = (props) => {
    return (
        <Link to={"/lists/" + props.list.listName}>
            <div className = "List" onClick={props.clicked}>
                {props.list.listName}
            </div>
        </Link>
    )
}

export default withRouter(list);
